class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
        items: [],
        DataisLoaded: false
    };
}
componentDidMount() {
    fetch('http://localhost:3001')
      .then(response => {
        debugger
        return response.json();
      })
      .then(data => {
        this.setState({
          items:data,
          DataisLoaded: true
        });
      });
  }
  render() {
    const { DataisLoaded, items } = this.state;
        if (!DataisLoaded) return <div>
            <h1> Pleses wait some time.... </h1> </div> ;
    return (
      <div>
        {items.map((item) =>

            <li key={item.player_id}> {item.name}</li>

        )}
      </div>
    )
  };
}

export default App;
